import React, { useState } from 'react';
import { GoogleLogout } from 'react-google-login';

function logOut(e){
    e.preventDefault();
    console.log("click");
    window.sessionStorage.login="false";
    window.sessionStorage.name=null;
    window.sessionStorage.email=null;
    window.location.href="/home";

}

function Report(){
    console.log("hey");


    if(window.sessionStorage.login && window.sessionStorage.login=="true"){
        console.log(window.sessionStorage.name);
        console.log(window.sessionStorage.email);
        return(
            <button onClick={logOut} >Logout</button>

        );

    }
    else{
        window.location.href="/home";
    }
}  


export default Report;
